          <Button className="bg-yellow-400 text-black">Deposit</Button>
        </CardContent>
      </Card>
      <Card className="bg-gray-900 p-4">
        <CardContent>
          <p className="text-lg font-bold">Trade</p>
          <p className="text-gray-400 mt-2">⏳ Pending</p>
        </CardContent>
      </Card>
    </div>
  );
}
